import home from "./components/home";
import login from "./components/login";
import registration from "./components/registration";
import Itemlist from "./components/Itemlist";


const routes =  [
  {
    path: '/',
    exact: true,
    component: home,
  },
  {
    path: '/login',
    component: login,
  },
  {
      path: '/registration',
      component: 'registration'
  },
  {
      path: '/items',
      component: 'Itemlist'
  }
]

export default routes
